import Footer from "./components/Footer";
import Bandeau from "./components/Bandeau";
import './App.css';


function App() {
  return (
    <div className="App">
      <div className="haut">
     <div className="heaBan">
     <Bandeau />
        <div className="headerRose">
     <Header />
     </div>
     </div>
     </div>
     <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Descriptif/:id" element={<Descriptif />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
